import React from "react";
import styled from "styled-components";

const Container = styled.div`
  flex: 1;
  padding: 16px;
  background: ${({ theme }) => theme.bg}

  @media (max-width: 768px) {
    padding: 6px 10px;
  }
`;

const GeneratedImageCard = () => {
  return (
    <Container>
      <Image />
    </Container>
  );
};

export default GeneratedImageCard;
